import Link from "next/link";
import { Space } from "antd";

const MenuBloc = ({ link, title, icon }) => {
  return (
    <Link href={link}>
      <a className="menu-bloc">
        <Space align="bottom" size={16}>
          <ion-icon name={icon}></ion-icon>
          <span>{title}</span>
        </Space>
      </a>
    </Link>
  );
};

export default MenuBloc;
